":{"id":"14194"},"toolbar_location":null,"width":300,"x_range":{"id":"14171"},"x_scale":{"id":"14175"},"y_range":{"id":"14173"},"y_scale":{"id":"14177"}},"id":"14168","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"14173","type":"DataRange1d"},{"attributes":{"axis":{"id":"14249"},"coordinates":null,"dimension":1,"grid_line_color":"#FFFFFF","grid_line_width":0.75,"group":null,"ticker":null},"id":"14252","type":"Grid"},{"attributes":{},"id":"14412","type":"AllLabels"},{"attributes":{},"id":"14313","type":"UnionRenderers"},{"attributes":{"axis_label":"$$\\nu / \\nu_{max}$$","axis_line_color":null,"coordinates":null,"formatter":{"id":"14439"},"group":null,"major_label_policy":{"id":"14440"},"major_tick_line_color":null,"minor_tick_line_color":null,"ticker":{"id":"14283"}},"id":"14282","type":"LinearAxis"},{"attributes":{},"id":"14125","type":"ResetTool"},{"attributes":{},"id":"14291","type":"HelpTool"},{"attributes":{"coordinates":null,"data_source":{"id":"14093"},"glyph":{"id":"14319"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"14321"},"nonselection_glyph":{"id":"14320"},"view":{"id":"14323"}},"id":"14322","type":"GlyphRenderer"},{"attributes":{"tools":[{"id":"14286"},{"id":"14287"},{"id":"14288"},{"id":"14289"},{"id":"14290"},{"id":"14291"}]},"id":"14293","type":"Toolbar"},{"attributes":{"axis":{"id":"14282"},"coordinates":null,"dimension":1,"grid_line_color":"#FFFFFF","grid_line_width":0.75,"group":null,"ticker":null},"id":"14285","type":"Grid"},{"attributes":{},"id":"14314","type":"Selection"},{"attributes":{"tools":[{"id":"14187"},{"id":"14188"},{"id":"14189"},{"id":"14190"},{"id":"14191"},{"id":"14192"}]},"id":"14194","type":"Toolbar"},{"attributes":{},"id":"14270","type":"DataRange1d"},{"attributes":{},"id":"14414","type":"BasicTickFormatter"},{"attributes":{},"id":"14289","type":"SaveTool"},{"attributes":{},"id":"14283","type":"BasicTicker"},{"attributes":{},"id":"14290","type":"ResetTool"},{"attributes":{"data":{"angle":["1.8569278169715375","3.455751918948773","0.970505571259276"],"color":["#8066ad","#8c8c8c","#f0ad4d"],"end_angle":{"__ndarray__":"jc5O8fm1/T8+md8dL0AVQBgtRFT7IRlA","dtype":"float64","order":"little","shape":[3]},"index":[0,1,2],"sector":["Metabolic"," Other","Ribosomal"],"start_angle":{"__ndarray__":"AAAAAAAAAACNzk7x+bX9Pz6Z3x0vQBVA","dtype":"float64","order":"little","shape":[3]}},"selected":{"id":"14314"},"selection_policy":{"id":"14313"}},"id":"14092","type":"ColumnDataSource"},{"attributes":{"align":"left","background_fill_color":"#FFFFFF","coordinates":null,"group":null,"offset":5,"text":"precursor dynamics","text_color":"#3c3c3c","text_font_size":"10pt","text_font_style":"normal"},"id":"14169","type":"Title"},{"attributes":{},"id":"14415","type":"AllLabels"},{"attributes":{},"id":"14286","type":"PanTool"},{"attributes":{},"id":"14287","type":"WheelZoomTool"},{"attributes":{"tools":[{"id":"14154"},{"id":"14155"},{"id":"14156"},{"id":"14157"},{"id":"14158"},{"id":"14159"}]},"id":"14161","type":"Toolbar"},{"attributes":{"args":{"Kd_cnt_slider":{"id":"14099"},"Kd_cpc_slider":{"id":"14098"},"Y_slider":{"id":"14100"},"cnt_slider":{"id":"14101"},"gamma_slider":{"id":"14096"},"nu_slider":{"id":"14097"},"phiO_slider":{"id":"14095"},"phiRb_slider":{"id":"14094"},"pie_source":{"id":"14092"},"source":{"id":"14093"}},"code":"\n// Define constants\nconst M0 = 0.001 * 1.5E17;\nconst cpc_0 = 0.01;\n\n// Parse the slider inputs\nlet phi_Rb = phiRb_slider.value;\nlet phi_O = phiO_slider.value;\nlet gamma_max = gamma_slider.value * (3600 / 7459);\nlet nu_max = nu_slider.value;\nlet Kd_cpc = Math.pow(10, Kd_cpc_slider.value);\nlet Kd_cnt = Math.pow(10, Kd_cnt_slider.value);\nlet c_nt = Math.pow(10, cnt_slider.value);\nlet Y  = Math.pow(10, Y_slider.value);\nphiRb_slider.end = (1 - phi_O)\n\n// Parse the data inputs\nlet data = source.data;\nlet pie = pie_source.data;\n\n// Given the inputs, set initial conditions and instantiate params and arg\nlet M_Rb_0 = phi_Rb * M0;\nlet M_Mb_0 = (1 - phi_Rb - phi_O) * M0;\nlet cnt_0 = c_nt;\nlet params = [M0, M_Rb_0, M_Mb_0, cpc_0, cnt_0];\nlet args = [gamma_max, nu_max, Y, phi_Rb, phi_O, Kd_cpc, Kd_cnt];\n\n// Get the time range and peform integration\nlet time = data['time'];\nlet dynamics = odeintForwardEuler(selfReplicator, params, args, 0.005, time.length);\n\n\n// Update the source\nfor (let i=0; i &lt; time.length; i++ ) {\n    data['rel_M'][i] = dynamics[i][0]/ M0;\n    data['cpc_Kd'][i] = dynamics[i][3] / Kd_cpc;\n    data['cnt_rel'][i] = dynamics[i][4] / cnt_0;\n    data['gamma'][i] = dynamics[i][3] / (dynamics[i][3] + Kd_cpc);\n    data['nu'][i] = dynamics[i][4] / (dynamics[i][4] + Kd_cnt);\n}\n\nsource.change.emit()\n\n// Update the pie chart\nlet angles = [2 * Math.PI * (1 - phi_O - phi_Rb), 2 * Math.PI * phi_O, 2 * Math.PI * phi_Rb];\nlet start_angles = [0, angles[0], angles[0] + angles[1]];\nlet end_angles = [angles[0], angles[0] + angles[1], angles[0] + angles[1] + angles[2]];\nfor (var i = 0; i &lt; 3; i++) {\n    pie['start_angle'][i] = start_angles[i];\n    pie['end_angle'][i] = end_angles[i];\n}\npie_source.change.emit()\n\n\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING SELF-REPLICATOR MODEL\n// /////////////////////////////////////////////////////////////////////////////\n\nfunction selfReplicator(params,args, dt) { \n    let [M, M_Rb, M_Mb, c_pc, c_nt] = params;\n    let [gamma_max, nu_max, Y, phi_Rb, phi_O, Kd_cpc, Kd_cnt] = args;\n\n    // Compute the transalational efficiency\n    let gamma = gamma_max * (c_pc / (c_pc + Kd_cpc));\n    let nu = nu_max * (c_nt / (c_nt + Kd_cnt));\n\n    // Define the biomass dynamics\n    let dM_dt = gamma * M_Rb;\n    \n    // Define allocation dynamics\n    let dM_Rb_dt = phi_Rb * dM_dt;\n    let dM_Mb_dt = (1 - phi_Rb - phi_O) * dM_dt;\n\n    // Define precursor dynamics\n    let dcpc_dt = (nu * M_Mb - dM_dt * (1 + c_pc)) / M;\n\n    // Define nutrient dynamics\n    let dcnt_dt = -nu * M_Mb / Y;\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dcpc_dt * dt, dcnt_dt * dt]\n}\n\nfunction ppGppSelfReplicator(params, args, dt) {\n    // Unpack params\n    var [M, M_Rb, M_Mb, T_AA, T_AA_star] = params;\n    var [gamma_max, nu_max, tau, Kd_TAA, Kd_TAA_star, kappa_max, phi_O] = args;\n\n    // Compute the rates\n    var nu = nu_max * (T_AA / (T_AA + Kd_TAA));\n    var gamma = gamma_max * (T_AA_star / (T_AA_star + Kd_TAA_star));\n\n    // Compute the allocation\n    var ratio = (T_AA_star / T_AA);\n    var phi_Rb = ratio / (ratio + tau); \n    var kappa = phi_Rb * kappa_max;\n\n    // Compute dynamics\n    var dM_dt = gamma * M_Rb\n    var dTAA_star_dt = (nu * M_Mb - dM_dt * (1 + T_AA_star)) / M\n    var dTAA_dt = kappa + ((dM_dt * (1 - T_AA) - nu * M_Mb) / M)\n    var dM_Rb_dt = phi_Rb * dM_dt\n    var dM_Mb_dt = (1 - phi_Rb - phi_O) * dM_dt\n\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dTAA_dt * dt, dTAA_star_dt * dt]\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING STEADY-STATE PARAMETERS\n// /////////////////////////////////////////////////////////////////////////////\nfunction steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let growth_rate = steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O)\n    return (nu_max * (1 - phi_Rb - phi_O) / growth_rate) - 1\n}\n\nfunction steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let Gamma = gamma_max * phi_Rb;\n    let Nu = nu_max * (1 - phi_Rb - phi_O);\n    let numer = Nu + Gamma - Math.sqrt(Math.pow(Nu + Gamma, 2) - 4 * (1 - Kd_cpc) * Nu * Gamma)\n    let denom = 2 * (1 - Kd_cpc);\n    return numer / denom\n}\n\nfunction steadyStateGamma(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let cpc = steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O);\n    return gamma_max * (cpc / (cpc + Kd_cpc));\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING ALLOCATION STRATEGIES\n// /////////////////////////////////////////////////////////////////////////////\nfunction optimalAllocation(gamma_max, nu_max, Kd_cpc, phi_O) {\n    let prefix = 1 / (4 * Kd_cpc * gamma_max * nu_max - Math.pow(nu_max + gamma_max, 2))\n    let bracket = 2 * Kd_cpc * gamma_max * nu_max - gamma_max * nu_max + Math.sqrt(Kd_cpc * gamma_max * nu_max) * (nu_max - gamma_max) - Math.pow(nu_max, 2)\n    return (1 - phi_O) * prefix * bracket\n}\n\nfunction constTranslation(gamma_max, nu_max, cpc_Kd, Kd_cpc, phi_O) { \n    let _cpc = cpc_Kd * Kd_cpc\n    return (1 - phi_O) * nu_max * (_cpc + Kd_cpc) / (nu_max  * (_cpc + Kd_cpc) + gamma_max * _cpc * (_cpc + 1));\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS FOR NUMERICAL INTEGRATION\n// /////////////////////////////////////////////////////////////////////////////\nfunction odeintForwardEuler(fun, params, args, dt, nSteps) { \n    let out = [params]; \n    for (let i=1; i &lt; nSteps ; i++) { \n        let deriv = fun(out[i-1], args, dt)\n        for (let j=0; j &lt; deriv.length; j++) {\n            deriv[j] = out[i-1][j] + deriv[j];\n        }\n        out.push(deriv);\n    }\n    return out\n}\n\nfunction ppGppEquilibrate(gamma_max, nu_max, tau, Kd_TAA, Kd_TAA_star, kappa_max, phi_O) {\n    // Determine 'optimal' allocation from simple model\n    let optPhiRb = optimalAllocation(gamma_max, nu_max, 0.01, phi_O);\n\n    // Set initial conditions\n    let M0 = 1E9;\n    let MRb = optPhiRb * M0;\n    let MMb = (1 - optPhiRb - phi_O) * M0;\n    let tAA = 0.00002; \n    let tAAStar = 0.00002;\n\n    // Define the timescale to integrate\n    let dt = 0.001;\n    let nSteps = parseInt(100 / dt);\n\n    // Pack parameters and args\n    let params = [M0, MRb, MMb, tAA, tAAStar];\n    let args = [gamma_max, nu_max, tau, Kd_TAA, Kd_TAA_star, kappa_max, phi_O];\n\n    // Perform integration\n    let out = odeintForwardEuler(ppGppSelfReplicator, params, args, dt, nSteps)\n\n    // Identify output\n    let eq = out.slice(-1)[0]   \n\n    // Compute steady-state params.\n    let eqPhiRb = eq[1] / eq[0];\n    let eqPhiMb = eq[2] / eq[0];\n    let eqTAA = eq[3];\n    let eqTAAStar = eq[4]; \n    let equil = [eqPhiRb, eqPhiMb, eqTAA, eqTAAStar];\n    return  equil\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// MISCELLANEOUS\n// /////////////////////////////////////////////////////////////////////////////\n\n// Function for linearly spacing values. Adapted from StackOverflow user mhodges\n// https://stackoverflow.com/questions/40475155/does-javascript-have-a-method-that-returns-an-array-of-numbers-based-on-start-s\nfunction linSpace(startValue, stopValue, nSteps) {\n  let arr = [];\n  let step = (stopValue - startValue) / nSteps;\n  for (var i = 0; i &lt; nSteps; i++) {\n    arr.push(startValue + (step * i));\n  }\n  return arr;\n}\n"},"id":"14348","type":"CustomJS"},{"attributes":{"background_fill_color":"#f0f3f7","below":[{"id":"14245"}],"center":[{"id":"14248"},{"id":"14252"}],"height":300,"left":[{"id":"14249"}],"renderers":[{"id":"14340"}],"title":{"id":"14235"},"toolbar":{"id":"14260"},"toolbar_location":null,"width":300,"x_range":{"id":"14237"},"x_scale":{"id":"14241"},"y_range":{"id":"14239"},"y_scale":{"id":"14243"}},"id":"14234","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"14180","type":"BasicTicker"},{"attributes":{},"id":"14250","type":"BasicTicker"},{"attributes":{"axis":{"id":"14179"},"coordinates":null,"grid_line_color":"#FFFFFF","grid_line_width":0.75,"group":null,"ticker":null},"id":"14182","type":"Grid"},{"attributes":{"align":"left","background_fill_color":"#FFFFFF","coordinates":null,"group":null,"offset":5,"text":"steady-state proteome composition","text_color":"#3c3c3c","text_font_size":"10pt","text_font_style":"normal"},"id":"14103","type":"Title"},{"attributes":{"axis_label":"time [hr]","axis_line_color":null,"coordinates":nu
